import React from 'react';
import { useEffect } from 'react';

import Animation from '../../services/Animation';
import Flash from '../../services/Flash';

import '../css/CookieDialog.css';

function CookieDialog() {

    useEffect(() => {
        setTimeout(() => {
            Animation.toggleDivHorizontal('cookie-dialog', true, 500, 0);
        }, 1000);
    }, []);

    return (
        <div id='cookie-dialog' className='cookie-dialog'>
            <div>
                    <i className='fas fa-times'></i>
                <h3 className='secondary mb-10 '>Website uses Cookies to enhance your experience</h3>
                <p>We use cookies to ensure you have the best browsing experience on our website. By using our site, you acknowledge that you have read and understood our <a href='' className='primary'>Cookie Policy</a> & <a href='' className='primary'>Privacy Policy</a></p>
                <div className='flex-row jc-e'>
                    <button className='btn btn-primary btn-small'>Accept</button>
                </div>
            </div>
        </div>
    );
}

export default CookieDialog;
